import React from 'react';
import { supabase } from './lib/helper/supabaseClient'; // Import supabase client
import icon from './xdd.jpg'; 
import './Dashboard-Student-Style.css'; 

const StudentLogin = () => {
  const logout = async () => {
    // Log out the user using Supabase's signOut method
    await supabase.auth.signOut();
    // Optionally, you can handle state updates for user here, like redirecting to the login page
    console.log("User logged out");
  };

  return (
    <div>
      {/* Navigation Bar */}
      <nav className="navbar">
        <div className="nav-left">
          <img src={icon} alt="Logo" className="logo" />
          <ul className="nav-links">
            <li><a href="#">Home</a></li>
            <li><a href="#" className="active">Dashboard</a></li>
            <li><a href="#">Users</a></li>
            <li><a href="#">Theses</a></li>
            <li><a href="#">Reports</a></li>
          </ul>
        </div>
        <div className="nav-right">
          <div className="notification-icon">
            <img src={icon} alt="Bell Icon" className="bell-icon" />
          </div>
          <div className="profile-icon">
            <img src={icon} alt="User Icon" />
            <button className="down-button">
              <img src={icon} alt="Down Arrow" />
            </button>
          </div>
        </div>
      </nav>

      {/* Dashboard */}
      <div className="dashboard-container">
        <h1>Dashboard</h1>
        <div className="search-bar">
          <img src={icon} alt="Search Icon" className="search-icon" />
          <input type="text" placeholder="Search" />
        </div>
        {/* Logout Button */}
        <button onClick={logout} className="logout-button">Logout</button>
      </div>
    </div>
  );
};

export default StudentLogin;
